<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <title>Wild Terra 2 Wiki</title>
    <style>
        :root { --bg: #1e1e1e; --card: #252526; --text: #d4d4d4; --accent: #3794ff; --border: #333; --green: #4ec9b0; --yellow: #dcdcaa; }
        body { font-family: 'Segoe UI', sans-serif; background: var(--bg); color: var(--text); margin: 0; padding: 0; }
        nav { background: #2d2d2d; padding: 15px 30px; display: flex; align-items: center; border-bottom: 1px solid var(--border); position: sticky; top: 0; z-index: 100; }
        h1 { margin: 0 20px 0 0; color: #fc0; font-size: 1.5rem; }
        .nav-btn { background: transparent; border: none; color: #888; font-size: 1.1rem; margin-right: 20px; cursor: pointer; padding: 5px 0; }
        .nav-btn.active { color: white; border-bottom: 2px solid var(--accent); }
        .controls { display: flex; gap: 10px; margin-left: auto; }
        input, select { background: #3c3c3c; border: 1px solid #555; color: white; padding: 8px; border-radius: 4px; }
        #content { padding: 20px; display: grid; grid-template-columns: repeat(auto-fill, minmax(380px, 1fr)); gap: 20px; }
        .card { background: var(--card); border: 1px solid var(--border); border-radius: 8px; padding: 15px; display: flex; flex-direction: column; box-shadow: 0 4px 6px rgba(0,0,0,0.3); }
        .card h2 { margin: 0 0 10px 0; color: var(--green); border-bottom: 1px solid var(--border); padding-bottom: 5px; display: flex; justify-content: space-between; }
        .lvl-badge { background: #333; padding: 2px 8px; border-radius: 4px; font-size: 0.8em; color: var(--yellow); }
        .stats-grid { display: grid; grid-template-columns: 1fr 1fr; gap: 5px; margin-bottom: 10px; font-size: 0.9em; }
        .stat-label { color: #888; }
        .section-title { font-size: 0.85em; text-transform: uppercase; letter-spacing: 1px; color: #666; margin-top: 10px; border-bottom: 1px solid #333; }
        .tag { background: #3a3a3a; padding: 2px 6px; border-radius: 3px; font-size: 0.8rem; margin: 2px; display: inline-block; border: 1px solid #444; }
        table { width: 100%; border-collapse: collapse; font-size: 0.85em; margin-top: 5px; }
        td { padding: 4px; border-bottom: 1px solid #333; }
        .skill-dmg { color: #ff6666; }
        .drop-row { display: flex; justify-content: space-between; border-bottom: 1px dotted #444; padding: 4px 0; font-size: 0.9em; }
        .item-link { color: var(--accent); cursor: pointer; text-decoration: none; }
        .item-link:hover { text-decoration: underline; }
    </style>
</head>
<body>
<nav>
    <h1>WT2 DB</h1>
    <button class="nav-btn active" onclick="setTab('mobs')">Bestiary</button>
    <button class="nav-btn" onclick="setTab('recipes')">Crafting</button>
    <div class="controls">
        <input type="text" id="search" placeholder="Search..." onkeyup="render()">
        <select id="sort" onchange="render()">
            <option value="name">Name</option>
            <option value="level">Level</option>
            <option value="hp">Health</option>
        </select>
    </div>
</nav>
<div id="content"></div>

    let currentTab = 'mobs';

    function setTab(tab) {
        currentTab = tab;
        document.querySelectorAll('.nav-btn').forEach(b => b.classList.remove('active'));
        event.target.classList.add('active');
        document.getElementById('sort').style.display = tab === 'mobs' ? 'block' : 'none';
        render();
    }

    function render() {
        const container = document.getElementById('content');
        container.innerHTML = "";
        const query = document.getElementById('search').value.toLowerCase();
        const sortType = document.getElementById('sort').value;

        if (currentTab === 'mobs') {
            let list = MOBS.filter(m => {
                if (m.m_Name.toLowerCase().includes(query)) return true;
                // Check Drops (by Mob Name OR Corpse Name)
                let drops = DROPS[m.m_Name] || DROPS[m.m_Name + "Corpse"] || [];
                if (drops.some(i => i.item.toLowerCase().includes(query))) return true;
                return false;
            });
            
            list.sort((a, b) => {
                if (sortType === 'level') return (parseInt(b.level)||0) - (parseInt(a.level)||0);
                if (sortType === 'hp') return (parseInt(b.health)||0) - (parseInt(a.health)||0);
                return a.m_Name.localeCompare(b.m_Name);
            });

            list.slice(0, 100).forEach(mob => container.appendChild(createMobCard(mob)));
        } else {
            let list = RECIPES.filter(r => {
                if (r.name.toLowerCase().includes(query)) return true;
                if (r.outputs.some(o => (ITEMS[o.guid]||"").toLowerCase().includes(query))) return true;
                return false;
            });
            list.slice(0, 100).forEach(recipe => container.appendChild(createRecipeCard(recipe)));
        }
    }

    function createMobCard(mob) {
        const div = document.createElement('div');
        div.className = 'card';
        
        // --- LOOT LOGIC ---
        // Try exact name first, then append "Corpse"
        let drops = DROPS[mob.m_Name] || DROPS[mob.m_Name + "Corpse"] || [];
        
        let dropsHtml = "";
        if (drops.length > 0) {
            dropsHtml = `<div class="section-title">Loot</div>`;
            drops.forEach(d => {
                const chance = d.chance ? `${Math.round(d.chance*100)}%` : "";
                const groupStyle = d.isGroup ? "font-style:italic; color:#aaa;" : "";
                dropsHtml += `<div class="drop-row">
                    <span class="item-link" style="${groupStyle}" onclick="searchRecipe('${d.item.split(',')[0]}')">${d.item}</span>
                    <span>${d.amount} ${chance}</span>
                </div>`;
            });
        }

        // --- SKILLS ---
        let skillsHtml = "";
        if (mob.linkedSkills && mob.linkedSkills.length > 0) {
            skillsHtml = `<div class="section-title">Attacks</div><table>`;
            mob.linkedSkills.forEach(s => {
                skillsHtml += `<tr><td>${s.name}</td><td class="skill-dmg">${s.damage}</td><td>${s.cd}s</td></tr>`;
            });
            skillsHtml += `</table>`;
        }

        // --- BONUSES ---
        let bonusHtml = "";
        if (mob.displayBonuses && mob.displayBonuses.length > 0) {
            bonusHtml = `<div style="margin-top:10px;">${mob.displayBonuses.map(b => `<span class="tag">${b}</span>`).join('')}</div>`;
        }

        div.innerHTML = `
            <h2>${mob.m_Name} <span class="lvl-badge">Lvl ${mob.level||'?'}</span></h2>
            <div class="stats-grid">
                <div><span class="stat-label">HP:</span> ${mob.health}</div>
                <div><span class="stat-label">Speed:</span> ${mob.walkSpeed}/${mob.runSpeed}</div>
                <div><span class="stat-label">Notice:</span> ${mob.noticeDistance||'?'}</div>
                <div><span class="stat-label">Class:</span> ${mob.entityClass}</div>
            </div>
            ${bonusHtml}
            ${skillsHtml}
            ${dropsHtml}
        `;
        return div;
    }

    function createRecipeCard(r) {
        const div = document.createElement('div');
        div.className = 'card';
        const row = (list) => list.map(i => `
            <div class="drop-row">
                <span class="item-link" onclick="searchRecipe('${ITEMS[i.guid]}')">${ITEMS[i.guid] || i.guid}</span>
                <span>x${i.amount}</span>
            </div>`).join('');

        div.innerHTML = `
            <h2>${r.name} ${r.secret ? '<span style="color:red;font-size:0.7em">(Secret)</span>' : ''}</h2>
            <div>${row(r.inputs)}</div>
            <div style="text-align:center;color:#666;margin:5px;"></div>
            <div>${row(r.outputs)}</div>
        `;
        return div;
    }

    function searchRecipe(name) {
        setTab('recipes');
        document.getElementById('search').value = name;
        render();
    }
    
    render();
</script>
